import './portfolio3.css';
import Header from './Header.js';
import Hero from './Hero.js';
import About from './About.js';
import Skills from './Skills.js';
import Portfolio from './Portfolio.js';
import Contact from './Contact.js';

function App() {
  return (
    <div className="App">
        <Header />
        <Hero />
        <About />
        <Skills />
        <Portfolio />
        <Contact />
    </div>
  );
}

export default App;
